drop  table if exists barcode_checkout_spread;

drop table if exists ptype_key;

create temp table ptype_key (id int, branch text);


create temp table barcode_checkout_spread  (barcode varchar, checkout int) ;


with barcode_checkout as (
select barcode, sum(checkout) as checkout from 
barcode_checkout_spread
group by barcode)


select bc.barcode, bc.checkout, ptype_code, ptype_key.branch, patron_record_address_type_id, addr1, addr2, addr3, village, city, region, postal_code, city, country

from barcode_checkout bc 
left join sierra_view.patron_view on bc.barcode = patron_view.barcode 

left join sierra_view.patron_record_address 
on patron_view.id = patron_record_address.patron_record_id

join ptype_key 
on ptype_code = ptype_key.id;